    "GPS Jammer Detection and Gelocation using CoNNeCT L-Band SDR Project",nt"tracking_summary":
    {ntt"total": 15,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:26:15.415257",nt"name": "gps-jammer-detection-and-gelocation-using-connect-l-band-sdr-project",nt"isopen":
    true,nt"url": null,nt"notes": "Under this proposed effort, we plan to test
    the feasibility of adapting our terrestrial jammer locator system (JLOC) to locating
    jamming signals in space by adapting our previously developed GPS software defined
    radio (SDR) technology to provide an SDR waveform that can operate on spacecraft
    to allow detection and identification of GPS interference.  We shall also experiment
    with this waveform to determine how the motion of a low earth orbiting platform
    can be used to provide geolocation of the interference source.",nt"license_title":
